INSERT INTO `questões` (`id`, `area_conhecimento`, `questao`) VALUES
(1, 'Língua Portuguesa - Linguagem', 'Entender instruções expressas \r\nde forma negativa. '),
(2, 'Língua Portuguesa - Linguagem', 'Expressar-se verbalmente, \r\npronunciando palavras de \r\nforma clara, espontânea e \r\nconfiante.'),
(3, 'Língua Portuguesa - Linguagem', 'Atentar, memorizar, assimilar \r\ne executar ordens tanto \r\nsimples quanto complexas.'),
(4, 'Língua Portuguesa - Linguagem', 'Compreender o significado \r\nde texto ou história, \r\nidentificando a ideia central. '),
(5, 'Língua Portuguesa - Linguagem', 'Demonstrar interesse na \r\nleitura de histórias.'),
(6, 'Língua Portuguesa - Linguagem', 'Elaborar e relatar histórias de \r\nmaneira oral, a partir de \r\nimagens ou temas sugeridos.'),
(7, 'Língua Portuguesa - Linguagem', 'Engajar-se em diálogos.'),
(8, 'Língua Portuguesa - Linguagem', 'Familiarizar-se com novas \r\npalavras.'),
(9, 'Língua Portuguesa - Linguagem', 'Incorporar vocabulário \r\nrecente em suas conversas.'),
(10, 'Língua Portuguesa - Linguagem', 'Formular diversas perguntas.'),
(11, 'Língua Portuguesa - Linguagem', 'Memorizar e entoar canções \r\ninfantis ou parlendas. '),
(12, 'Língua Portuguesa - Linguagem', 'Relatar eventos de sua vida \r\ncotidiana, seguindo a lógica \r\ncronológica.'),
(13, 'Língua Portuguesa - Escrita', 'Utilizar diversos instrumentos e \r\nmateriais de escrita para \r\nrealizar desenhos, traçar \r\nletras e outros símbolos \r\ngráficos.'),
(14, 'Língua Portuguesa - Escrita', 'Reproduzir histórias ouvidas \r\npor meio de recontos escritos, \r\ncom o professor atuando \r\ncomo escriba.'),
(15, 'Língua Portuguesa - Escrita', 'Realizar escritos de forma \r\nespontânea.'),
(16, 'Língua Portuguesa - Escrita', 'Formar seu nome utilizando \r\nletras móveis, sem depender \r\ndo crachá. '),
(17, 'Língua Portuguesa - Escrita', 'Reproduzir seu próprio nome \r\npor meio de cópia sem o \r\nauxílio de guias pontilhadas. '),
